local t = 0
local i = 1

RunService.RenderStepped:Connect(function(dt)
    t = t + dt
    if t > frames[#frames].Time then
        cam.CameraType = Enum.CameraType.Custom
        hum.AutoRotate = true
        return
    end

    while i < #frames and t >= frames[i+1].Time do i = i + 1 end
    if i >= #frames then return end

    local a,b = frames[i], frames[i+1]
    local alpha = (t - a.Time) / (b.Time - a.Time)

    local pos = a.Pos:Lerp(b.Pos, alpha)
    local vel = a.Vel:Lerp(b.Vel, alpha)
    local mv = a.Move:Lerp(b.Move, alpha)
    local cf = a.CFrame:Lerp(b.CFrame, alpha)
    local fov = a.FOV + (b.FOV - a.FOV) * alpha

    cam.CFrame = cf
    cam.FieldOfView = fov

    local look = Vector3.new(cf.LookVector.X, 0, cf.LookVector.Z).Unit
    if look.Magnitude > 0 then
        hrp.CFrame = CFrame.new(pos, pos + look * 8)
    end

    hum:Move(mv, true)
    hrp.AssemblyLinearVelocity = vel

    if (alpha < 0.5 and a.Jump) or (alpha >= 0.5 and b.Jump) then
        hum.Jump = true
    end
end)
